import { useState } from 'react';
import React from 'react';

const App = () => {
  const [number, setNumber] = useState(20);
  const [present, setPresent] = useState(1);
  const increaseNumber = () => {
    setNumber(number + 1);
  };
  const increasePresents = () => {
    setPresents(present + 1);
  };
  return (
    <div>
      <p>Hoy tengo {number} años de edad</p>
      <button onClick={increaseNumber}>Hazme más viejo</button>
      <p>Tengo {present} regalo</p>
      <button onClick={increaseNumber}>Dame regalos</button>
    </div>
  );
};

export default App;
